  const access_token=localStorage.getItem('access_token') ? localStorage.getItem('access_token') : null

  const router=createBrowserRouter([
    { path: "/", element: <App/>},
    { path: "/registerIns", element: <TeacherRegister/>},
    { path: "/registerStd", element: <StudentRegister/>},
    { path: "/loginIns", element: <TeacherLogin/>},
    { path: "/loginStd", element: <StudentLogin/>},

  ])

  useEffect(()=>{
    fetchAuthUser();
  })


return(
  <React.StrictMode>
    <NavBar/>
    <RouterProvider router={router} />
  </React.StrictMode>
)

